Tipo de una función Dentro de GHCi, es posible conocer el tipo de una función o método a través del comando :type o su alias :t. Por ejemplo, el operador +: :t (+)
(+) :: Num a => a -> a -> a Esto nos indica que el operador + (determinado por el símbolo ::) toma dos valores a y devuelve otro a, que como determina la sintaxis Num a, será del tipo numérico, o más específicamente de la clase Num. Funciones Una función es un conjunto de reglas que indica para cada valor de entrada cual será el resultado . En Haskell, para definir una función deberemos primero indentificar que tipo tendrá, y luego desarrollar su funcionamiento. Por ejemplo, para una función que tome un nombre como valor de entrada para luego devolver un saludo, podríamos hacerlo de la siguiente forma: greet :: [Char] -> [Char];
greet name = "Hola, " ++ name; Donde podemos ver que definimos que greet tomará un valor de entrada del tipo [Char] (usado normalmente para cadenas de caracteres) y devolverá otro del mismo tipo. Debajo, vemos la definición propia de la función, donde tomando un argumento name, procederemos a unirlo a una frase "Hola, ", a través del operador ++. Es importante entender que el operador ++ es solo válido para este tipo de valores, puesto que no funciona con valores numéricos.

